description:
France: The Wild Side

Nature Documentary hosted by Paul McGann, published by BBC broadcasted as part of BBC Natural World series in 2014 - English narration


Information
------------------------------

France is our closest neighbour and a popular holiday destination for many of us, but how familiar are we with its wildlife? With breathtaking photography, this film reveals that wolves, wild boar and even bears are living amongst France's many mountains, valleys and forests. Journeying from the Pyrenees to the Alps, all around the mainland to Corsica, this is the story of the 'wild side' of France.

